import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Menampilkan paragraf di dalam elemen dengan id root
ReactDOM.render(<p>Hello</p>, document.getElementById('root'));

reportWebVitals();

// React merender HTML ke halaman web dengan menggunakan fungsi ReactDOM.render()
// Fungsi ReactDOM.render() mengambil dua argumen, yaitu kode HTML dan elemen HTML
// TUjuan fungsi ReactDOM.render() adalah menampilkan kode HTML tertentu di dalam elemen HTML tertentu
